ve that our most difficult moments as well as our most loving moments have been while traveling. That is why I believe that the best way to see how you handle conflict and resolution is to take a trip together. How you can handle a cancelled plane, near mugging, lost luggage, missing your stop on the London tube, illness abroad, jet lag, plane stalling and falling in the sky, sleeping in the back of a car, sudden change of plans, getting lost in a foreign country, running into wildlife like a black bear, and immersion in a different culture together can show all your true colors. If you can handle all of that, then you can handle the big stuff. Because in life there are a lot of difficult events, much worse than the experiences you face on the open road. The beautiful moments like this sunset are the rewards for making it through the tough stuff. It takes a lot of work to get here. 

